CREATE TABLE `grafix2`.`ceps` (
  `id` BIGINT(20) NOT NULL AUTO_INCREMENT,
  `logradouro` VARCHAR(100) NULL,
  `bairro` VARCHAR(90) NULL,
  `cidade` VARCHAR(90) NULL,
  `uf` VARCHAR(2) NULL,
  `cep` VARCHAR(13) NULL,
  PRIMARY KEY (`id`));

